const nome = slashParams("nome");

if(nome.length >= 2 && nome.length <= 32) {
    const emoji = slashParams("emoji");
    const regex = emoji.toString().match(/<a?:.{1,32}:(?<id>[0-9]{18,19})>/);
    const id = regex?.groups?.id;

    if(regex) {
        let url;

        if(regex.input.startsWith("<a")) {
            url = "https://cdn.discordapp.com/emojis/" + id + ".gif";
        } else {
            url = "https://cdn.discordapp.com/emojis/" + id + ".png";
        }

        this.storeValue(url, 1, "url", cache);
        this.callNextAction(cache);
    } else {
        cache.goToAnchor("erro-invalido");
    }
} else {
    cache.goToAnchor("erro-nome");
}

